CREATE OR REPLACE VIEW vw_trail_sections AS
 SELECT row_number() OVER (ORDER BY trails.trail_name) AS rownum,
    trails.trail_name,
    trails.trail_colour,
    trails.trail_offset,
    trails.section_name,
    trails.section_notes,
    trails.section_image,
    trails.section_grade_id,
    trails.geom
   FROM ( SELECT trail.name AS trail_name,
            trail.colour AS trail_colour,
            trail."offset" AS trail_offset,
            trail_section.name AS section_name,
            trail_section.notes AS section_notes,
            trail_section.image AS section_image,
            trail_section.grade_id AS section_grade_id,
            trail_section.geom
           FROM trail,
            trail_section,
            trail_sections
          GROUP BY trail.id, trail.name, trail_sections.trail_id, trail_sections.trail_section_id, trail_section.id, trail_section.name
         HAVING ((trail.id = trail_sections.trail_id) AND (trail_section.id = trail_sections.trail_section_id))
          ORDER BY trail.name) trails;


